\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B5%D1%80%D0%B4%D0%B8%D0%BD%D0%B0%D0%BD%D0%B4_II_(%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80_%D0%A1%D0%B2%D1%8F%D1%89%D0%B5%D0%BD%D0%BD%D0%BE%D0%B9_%D0%A0%D0%B8%D0%BC%D1%81%D0%BA%D0%BE%D0%B9_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D0%B8)\" title=\"\u0424\u0435\u0440\u0434\u0438\u043d\u0430\u043d\u0434 II (\u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 \u0421\u0432\u044f\u0449\u0435\u043d\u043d\u043e\u0439 \u0420\u0438\u043c\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438)\">\u0424\u0435\u0440\u0434\u0438\u043d\u0430\u043d\u0434\u043e\u043c II \u0413\u0430\u0431\u0441\u0431\u0443\u0440\u0433\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1741_%D0%B3%D0%BE%D0%B4\" title=\"1741 \u0433\u043e\u0434\">1741<\/a>&#160;\u2014 \u0433\u0440\u0435\u043d\u0430\u0434\u0435\u0440\u0441\u043a\u0430\u044f \u0440\u043e\u0442\u0430 \u043b\u0435\u0439\u0431-\u0433\u0432\u0430\u0440\u0434\u0438\u0438 \u041f\u0440\u0435\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u043b\u043a\u0430, \u043f\u0440\u0438 \u0441\u043e\u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0438 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0431\u044b\u043b\u0430 \u0432\u043e\u0437\u0432\u0435\u0434\u0435\u043d\u0430 \u043d\u0430 \u043f\u0440\u0435\u0441\u0442\u043e\u043b \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u0440\u0438\u0446\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BB%D0%B8%D0%B7%D0%B0%D0%B2%D0%B5%D1%82%D0%B0_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%BD%D0%B0\" title=\"\u0415\u043b\u0438\u0437\u0430\u0432\u0435\u0442\u0430 \u041f\u0435\u0442\u0440\u043e\u0432\u043d\u0430\">\u0415\u043b\u0438\u0437\u0430\u0432\u0435\u0442\u0430 \u041f\u0435\u0442\u0440\u043e\u0432\u043d\u0430<\/a>, \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u0430 \u043d\u0430\u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%B9%D0