itle=\"1799 \u0433\u043e\u0434\">1799<\/a>&#160;\u2014 \u043e\u043a\u043e\u043d\u0447\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0435 \u043f\u0440\u0435\u043a\u0440\u0430\u0449\u0435\u043d\u0438\u0435 \u0441\u0440\u043e\u043a\u0430 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u043f\u0440\u0438\u0432\u0438\u043b\u0435\u0433\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%9E%D1%81%D1%82-%D0%98%D0%BD%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%BE%D0%BC%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0411\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0430\u044f \u041e\u0441\u0442-\u0418\u043d\u0434\u0441\u043a\u0430\u044f \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f\">\u041e\u0441\u0442-\u0418\u043d\u0434\u0441\u043a\u043e\u0439 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1825_%D0%B3%D0%BE%D0%B4\" title=\"1825 \u0433\u043e\u0434\">1825<\/a>&#160;\u2014 \u043f\u0435\u0440\u0435\u0434 \u0441\u0442\u0440\u043e\u0435\u043c \u0432\u043e\u0441\u0441\u0442\u0430\u0432\u0448\u0438\u0445 \u0441\u043e\u043b\u0434\u0430\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D0%B5_%D0%A7%D0%B5%D1%80%D0%BD%D0%B8%D0%B3%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%BF%D0%BE%D0%BB%D0%BA%D0%B0\" title=\"\u0412\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 \u0427\u0435\u0440\u043d\u0438\u0433\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u043b\u043a\u0430\">\u0427\u0435\u0440\u043d\u0438\u0433\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u043b\u043a\u0430<\/a> \u043f\u0440\u043e\u0447\u0438\u0442\u0430\u043d\u0430 \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u043d\u0430\u044f \u041c\u0443\u0440\u0430\u0432\u044c\u0451\u0432\u044b\u043c-\u0410\u043f\u043e\u0441\u0442\u043e\u043b\u043e\u043c \u0438 \u041c.&#160;\u041f.&#160;\u0411\u0435\u0441\u0442\u0443\u0436\u0435\u0432\u044b\u043c-\u0420\u044e\u043c\u0438\u043d\u044b\u043c \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u043e\u043d\u043d\u0430\u044f \u043f\u0440\u043e\u043a\u043b\u0430\u043c\u0430\u0446\u0438\u044f \u00ab\u041f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u044b\u0439 \u043a\u0430\u0442\u0435\u0445\u0438\u0437\u0438\u0441\u00bb, \u043f\u0440\u0438\u0437\u044b\u0432\u0430\u0432\u0448\u0430\u044f \u043a \u0432\u043e\u043e\u0440\u0443\u0436\u0451\u043d\u043d\u043e\u043c\u0443 \u0432\u044b\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u044e \u043f\u0440\u043e\u0442\u0438\u0432 \u0441\u0430\u043c\u043e\u0434\u0435\u0440\u0436\u0430\u0432\u0438\u044f, \u043a\u0440\u0435\u043f\u043e\u0441\u0442\u043d\u043e\u0433\u043e \u043f\u0440\u0430\u0432\u0430 \u0438 \u0440\u0435\u043a\u0440\u0443\u0442\u0447\u0438\u043d\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1877_%D0%B3%D0%BE%D0%B4\" title=\"1877 \u0433\u043e\u0434\">1877<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%BE-%D1%82%D1%83%D1%80%D0%B5%D1%86%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_(1877%E2%80%941878)\" title=\"\u0420\u0443\u0441\u0441\u043a\u043e-\u0442\u0443\u0440\u0435\u0446\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1877\u20141878)\">\u0420\u0443\u0441\u0441\u043a\u043e-\u0442\u0443\u0440\u0435\u0446\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a> \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%83%D1%80%D0%BA%D0%BE,_%D0%98%D0%BE%D1%81%D0%B8%D1%84_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0413\u0443\u0440\u043a\u043e, \u0418\u043e\u0441\u0438\u0444 \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u043e\u0432\u0438\u0447\">\u0418\u