0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C\" title=\"\u041a\u0435\u043c\u0435\u0440\u043e\u0432\u0441\u043a\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c\">\u041a\u0435\u043c\u0435\u0440\u043e\u0432\u0441\u043a\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c<\/a> \u0432\u043e \u0432\u0442\u043e\u0440\u043e\u0439 \u0440\u0430\u0437 \u043d\u0430\u0433\u0440\u0430\u0436\u0434\u0435\u043d\u0430 \u043e\u0440\u0434\u0435\u043d\u043e\u043c \u041b\u0435\u043d\u0438\u043d\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%98%D0%BB-18_%D0%BF%D0%BE%D0%B4_%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD%D0%B3%D1%80%D0%B0%D0%B4%D0%BE%D0%BC_(1970)\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0418\u043b-18 \u043f\u043e\u0434 \u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u043e\u043c (1970)\">\u0430\u0432\u0438\u0430\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0418\u043b-18<\/a> \u043f\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u043e\u043c<\/a><\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1975_%D0%B3%D0%BE%D0%B4\" title=\"1975 \u0433\u043e\u0434\">1975<\/a>&#160;\u2014 \u0432 \u043f\u0440\u0438\u0431\u0440\u0435\u0436\u043d\u043e\u0439 \u0447\u0430\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B5%D0%BB%D1%8C%D1%84%D0%BE%D0%B2%D1%8B%D0%B9_%D0%BB%D0%B5%D0%B4%D0%BD%D0%B8%D0%BA\" title=\"\u0428\u0435\u043b\u044c\u0444\u043e\u0432\u044b\u0439 \u043b\u0435\u0434\u043d\u0438\u043a\">\u0448\u0435\u043b\u044c\u0444\u043e\u0432\u043e\u0433\u043e \u043b\u0435\u0434\u043d\u0438\u043a\u0430<\/a> \u0424\u0438\u043b\u044c\u0445\u043d\u0435\u0440\u0430 \u0432 \u0417\u0430\u043f\u0430\u0434\u043d\u043e\u0439 \u0410\u043d\u0442\u0430\u0440\u043a\u0442\u0438\u0434\u0435 \u043e\u0442\u043a\u0440\u044b\u0442\u0430 \u0441\u0435\u0437\u043e\u043d\u043d\u0430\u044f \u043d\u0430\u0443\u0447\u043d\u0430\u044f \u0441\u0442\u0430\u043d\u0446\u0438\u044f \u0438 \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u043e\u043d\u043d\u0430\u044f \u0431\u0430\u0437\u0430 \u0414\u0440\u0443\u0436\u043d\u0430\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1989_%D0%B3%D0%BE%D0%B4_%D0%B2_%D0%B8%D1%81%D1%82%D0%BE%D1%80%D0%B8%D0%B8_%D0%BC%D0%B5%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B5%D0%BD%D0%B0\" title=\"1989 \u0433\u043e\u0434 \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u043c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d\u0430\">1989<\/a>&#160;\u2014 \u043e\u0442\u043a\u0440\u044b\u0442 \u043f\u0435\u0440\u0432\u044b\u0439 \u0443\u0447\u0430\u0441\u0442\u043e\u043a \u0434\u043b\u0438\u043d\u043e\u0439 1,9&#160;\u043a\u043c \u0442\u0440\u0435\u0442\u044c\u0435\u0439, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%8B%D1%80%D0%B5%D1%86%D0%BA%D0%BE-%D0%9F%D0%B5%D1%87%D0%B5%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%BB%D0%B8%D0%BD%D0%B8%D1%8F\" title=\"\u0421\u044b\u0440\u0435\u0446\u043a\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u043a\u0430\u044f \u043b\u0438\u043d\u0438\u044f\">\u0421\u044b\u0440\u0435\u0446\u043a\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u043a\u043e\u0439 \u043b\u0438\u043d\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D0%B5%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B5%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B5%D0%BD\" title=\"\u041a\u0438\u0435\u0432\u0441\u043a\u0438\u0439 \u043c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d\">\u041a\u0438\u0435\u0432\u0441\u043a\u043e\u0433\u043e \u043c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d\u0430<\/a>, \u0441 \u0442\u0440\u0435\u043c\u044f \u0441\u0442\u0430\u043d\u0446\u0438\u044f\u043c\u0438: <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%BE%D0%BB%D0%BE%D1%82%D1%8B%D0%B5_%D0%B2%D0%BE%D1%80%D0%BE%D1%82%D0%B0_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F_%D0%BC%D0%B5%D1%82%D1%80%D0%BE)\" title=\"\u0417\u043e\u043b\u043e\u0442\u044b\u0435 \u0432\u043e\u0440\u043e\u0442\u0430 (\u0441\u0442\u0430\u043d\u0446\u0438\u044f \u043c\u0435\u0442\u0440\u043e)\">\u00ab\u0417\u043e\u043b\u043e\u0442\u044b\u0435 \u0432\u043e\u0440\u043e\u0442\u0430\u00bb<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B2%D0%BE%D1%80%D0%B5%D1%86_%D1%81%D0%BF%D0%BE%D1%80%D1%82%D0%B0_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F_%D0%BC%D0%B5%D1%82%D1%80%D0%BE,_%D0%9A%D0%B8%D0%B5%D0%B2)\" title=\"\u0414\u0432\u043e\u0440\u0435\u0446 \u0441\u043f\u043e\u0440\u0442\u0430 (\u0441\u0442\u0430\u043d\u0446\u0438\u044f \u043c\u0435\u0442\u0440\u043e, \u041a\u0438\u0435\u0432)\">\u00ab\u0414\u0432\u043e\u0440\u0435\u0446 \u0441\u043f\u043e\u0440\u0442\u0430\u00bb<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BB%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F_%D0%BC%D0%B5%D1%82%D1%80%D0%BE)\" title=\"\u041a\u043b\u043e\u0432\u0441\u043a\u0430\u044f (\u0441\u0442\u0430\u043d\u0446\u0438\u044f \u043c\u0435\u0442\u0440\u043e)\">\u00ab\u041c\u0435\u0447\u043d\u0438\u043a\u043e\u0432\u0430\u00bb<\/a> (\u043d\u044b\u043d\u0435 \u00ab\u041a\u043b\u043e\u0432\u0441\u043a\u0430\u044f\u00bb).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1994_%D0%B3%D0%BE%D0%B4\" title=\"1994 \u0433\u043e\u0434\">1994<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D0%B0%D1%8F_%D1%87%D0%B5%D1%87%D0%B5%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u041f\u0435\u0440\u0432\u0430\u044f \u0447\u0435\u0447\u0435\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u041f\u0435\u0440\u0432\u0430\u044f \u0447\u0435\u0447\u0435\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a>: \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u043d\u0430\u0447\u0430\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D1%82%D1%83%D1%80%D0%BC_%D0%93%D1%80%D0%BE%D0%B7%D0%BD%D0%BE%D0%B3%D0%BE_(1994%E2%80%941995)\" title=\"\u0428\u0442\u0443\u0440\u043c \u0413\u0440\u043e\u0437\u043d\u043e\u0433\u043e (1994\u20141995)\">\u0448\u0442\u0443\u0440\u043c \u0413\u0440\u043e\u0437\u043d\u043e\u0433\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1999_%D0%B3%D0%BE%D0%B4\" title=\"1999 \u0433\u043e\u0434\">1999<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BB%D1%8C%D1%86%D0%B8%D0%BD,_%D0%91%D0%BE%D1%80%D0%B8%D1%81_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0415\u043b\u044c\u0446\u0438\u043d, \u0411\u043e\u0440\u0438\u0441 \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0438\u0447\">\u0411\u043e\u0440\u0438\u0441 \u0415\u043b\u044c\u0446\u0438\u043d<\/a> \u0443\u0445\u043e\u0434\u0438\u0442 \u0432 \u043e\u0442\u0441\u0442\u0430\u0432\u043a\u0443 \u0441 \u043f\u043e\u0441\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B9_%D0%A4%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D0%B8\" title=\"\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438\">\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438<\/a>. \u0418\u0441\u043f\u043e\u043b\u043d\u044f\u044e\u0449\u0438\u043c \u043e\u0431\u044f\u0437\u0430\u043d\u043d\u043e\u0441\u0442\u0438 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430 \u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%83%D1%82%D0%B8%D0%BD,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041f\u0443\u0442\u0438\u043d, \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u043e\u0432\u0438\u0447\">\u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u041f\u0443\u0442\u0438\u043d<\/a>.<\/li><\/ul><h2>"}